import React from "react";
import { useAuth0 } from "@auth0/auth0-react";
import "./Navbar.css"
const LogoutButton = () => {
  const { logout } = useAuth0();

  return (
    <button className="bg-red border-2 rounded-lg text-white" onClick={() => logout({ logoutParams: { returnTo: window.location.origin } })}>
      Log Out
    </button>
  );
};

export default LogoutButton;
